  constructor(props){
    super(props)
    this.state = {
      bookList:[],
      searchTerm:'',
      printType:'',
      bookType:''
    }
  }



  componentDidMount(){
    const url = '"https://www.googleapis.com/books/v1/volumes?q=time:keyes&key=AIzaSyAUoZApaq9eRmbV9OaTTHFzrLSoeXCDbsA&printType=magazines"'

    fetch(url)
    .then(res=>{if(!res.ok){
      throw new Error(res.statusText)
    }
    console.log(typeof res)
  }
  ).then(res=>res.json())
  .then(
    data =>{
      console.log(data)
    }
  )
  }
  render() {
    return (
      <div className="App">
        <BookToolBar />
        <BookList />
      </div>
    );
  }
}

export default App;
